  true,\n\t\"url\": null,\n\t\"notes\": \"The Innovation Laboratory, Inc, proposes
  to use Automatic Dependent Surveillance &amp;#150; Broadcast (ADS-B) information
  as the basis of atmospheric wave and turbulence identification. Working in conjunction
  with the National Center for Atmospheric Research (NCAR), we research the feasibility
  of using the high rate ADS-B altitude information to detect the presence of mountain
  waves and Mountain Wave Turbulence (MWT) in the vicinity of steep terrain as well
  as atmospheric waves and turbulence from \",\n\t\"license_title\": \"U.S. Government
